import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Navbar from "./Navbar";

function App() {
  return;
  <BrowserRouter>
    <Navbar></Navbar>
    <Routes>
      <Route path="/" element={<></>}></Route>
      <Route path="" element={<></>}></Route>
      <Route path="" element={<></>}></Route>
      <Route path="" element={<></>}></Route>
    </Routes>
  </BrowserRouter>;
}

export default App;
